message:
Tínhamos 3 generais que se apresentaram pra assumir a frente do que fosse necessário.

Infelizmente, 6 militares traíram  a nação. Anotem aí e podem sentar o dedo.

Traidores da pátria:

*- Gen Freire Gomes:* ex-Cmt Ex - se acovardou. Está fugindo do país e irá morar em Barcelona, Espanha, na casa da filha;

*- Gen Stumpf:* amiguinho do Secretário Geral do TSE (nome aceito pelo Xandão para ser o futuro Cmt EB);

*- Gen Tomás:* foi ajudante de ordem do FHC por 4 anos. Pediu ao FHC para ser o Cmt Ex;

*- Gen Richard:* tentou articular com os FDP dos governadores do nordeste para ser o Cmt Ex;

*- Gen Amin:* tem as provas das fraudes das urnas (Ch do comando de defesa cibernética) e não fez nada;

*- Gen Soares:* amiguinho do Stumpf. Quer uma boquinha no governo do molusco.

Esses militares melaram tudo.

*Detalhe:*
*Gen Freire Gomes* está fugindo do país. Vai abandonar o Brasil e ir morar em Barcelona, Espanha, na casa da filha.

Esse é o resumo da ópera.
🇧🇷🇧🇷🇧🇷🇧🇷
👇👇

